//CADA REDUCER TIENE SU PROPIO STATE
//IMPORTANDO TYPES
import {
  TRAER_DOCUMENTOPDF,
  TRAER_DOCUMENTOPDF_EXITO,
  TRAER_DOCUMENTOPDF_ERROR,
} from "../types";

const initialState = {
  documento: [],
  error: null,
  loading: false,
};

export default function (state = initialState, action) {
  switch (action.type) {
    default:
      return state;
  }
}
